import React, { useState } from 'react';
import CsvLoader from './components/CsvLoader';

function App() {
  const [counties, setCounties] = useState([]);

  const handleDataLoaded = (csvData) => {
    setCounties(csvData); // Store the CSV data in state
  };

  return (
    <div className="App">
      <h1>County Data</h1>
      {/* Load and parse the CSV data */}
      <CsvLoader onDataLoaded={handleDataLoaded} />

      {/* Display the loaded data */}
      {counties.length > 0 ? (
        <div>
          <h2>Parsed Data:</h2>
          <ul>
            {counties.map((county, index) => (
              <li key={index}>
                {county.County} - {county.District}
              </li>
            ))}
          </ul>
        </div>
      ) : (
        <p>Loading data...</p>
      )}
    </div>
  );
}

export default App;
